var initialState = [
    {
        id : 1,
        name : "Iphone 6 Plus",
        image : "",
        description: "Sản phẩm do Apple sản xuất",
        price : 500,
        inventory : 5
    },
    {
        id : 2,
        name : "Iphone 7 Plus",
        image : "",
        description: "Sản phẩm do Apple sản xuất",
        price : 500,
        inventory : 5
    },
    {
        id : 3,
        name : "Iphone 8 Plus",
        image : "",
        description: "Sản phẩm do Apple sản xuất",
        price : 500,
        inventory : 5
    },
];

const reducer = (state = initialState, action) => {
    switch (action.type) {
        default:
            return state
    }
}

export default reducer;
